import css from "styled-jsx/css";

export default css`
  ul {
    display: flex;
    width: 60vh;
    justify-content: space-around;
    list-style: none;
    font-family: Verdana;
    border-bottom: 1px solid lightgrey;
  }

  a {
    text-decoration: none;
  }

  li:hover {
    border: 3px solid grey;
  }
`;
